import React from 'react';
import { Link } from 'react-router-dom';

export default function Webpage() {
  return (
    <div className='homepage'>
      <header className='homepage-header'>
        <Link to="/login">
          <button className='homepage-login-button'>Login</button>
        </Link>
      </header>
      <main className='homepage-main'>
        <h1>CHANGE THE WAY YOU MONEY</h1>
        <p>Learn the way you money online</p>
        <p>for those who want to learn how to perform online banking. Sign up in minutes.</p>
        <Link to="/signup">
          <button className='homepage-signup-button'>Sign Up</button>
        </Link>
      </main>
    </div>
  );
};
